import React, { Component } from 'react'
// import Button from 'react-bootstrap/Button'
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import {Link,Redirect} from 'react-router-dom';
import axios from 'axios';
import './Navbar.css' 
import { connect } from 'react-redux'

function Navs2() {
  // render(){
  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand>Career</Navbar.Brand>
        <Nav className="mr-auto">
          <Link className="link1" to="/">
            Home
          </Link>
          <Link className="link2" to="/list">
            List
          </Link>
          <Link className="link3" to="/about">
            About
          </Link>
          <Link className="link4" to="/signup">
            Signup
          </Link>
          <Link className="link5" to="/login">
            Login
          </Link>
        </Nav>
        <Form inline className="form1" onKeyUp={this.getData}>
          <FormControl
            name="search"
            value={this.state.title}
            onChange={this.hangleGet}
            type="text"
            placeholder="Search"
            className="mr-sm-2"
          />
          {/* <Button variant="outline-info" onChange={this.getData}>Search</Button> */}
        </Form>
      </Navbar>
    </div>
  );
  // }
}

export default connect(null, { logout })(Navs2);
